import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <>
      <header>TYS</header>
      <div className="body">
        <form>
          <div className="input">
            <label for="username">Username: </label>
            <input placeholder="Username" />
          </div>
          <div className="input">
            <label for="password">Password: </label>
            <input placeholder="Password" />
          </div>
          <button>Log in!</button>
        </form>
        <p>Don'y have an account with us yet?</p>
      </div>
    </>
  );
};

export default Home;
